  \"Toxicity of surface waters from Benton Lake National Wildlife Refuge and Freezout
  Lake Wildlife Management Area, Montana, to mallard ducklings\",\n\t\"tracking_summary\":
  {\n\t\t\"total\": 9,\n\t\t\"recent\": 1\n\t},\n\t\"groups\": [],\n\t\"relationships_as_subject\":
  [],\n\t\"revision_timestamp\": \"2016-07-27T22:42:26.030186\",\n\t\"name\": \"toxicity-of-surface-waters-from-benton-lake-national-wildlife-refuge-and-freezout-lake-wil\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"We measured the growth and survival of
  captive mallard (Anas platyrhvnchos) ducklings housed in wire cages during a 28-day
  drinking water bioassay to assess potential effects caused by their consumption
  of surface water. Surface water samples used in the bioassay drinking water treatments
  were collected from three sites in Benton Lake National Wildlife Refuge (NWR), three
  sites in Freezout Lake Wildlife Management Area (WMA), and a freshwater spring.
  Those sites provided a treatment range from low to high salinity and selenium. Mean
  selenium concentrations in duckling liver tissue at the end of the exposure were
  less than 4.5 ug/g-dry weight in all treatment groups and not significantly different
  among groups. These low selenium concentrations provide evidence that selenium uptake
  via drinking water is not a major pathway for the bioaccumulation of selenium by
  ducklings. Ducklings drinking water from a site within Freezout WMA that had a specific
  conductance of 43,000 uS/cm died during the first 72 hours of exposure. No other
  drinking water treatments caused significant duckling mortality during the bioassay.
  From day 7 through the remainder of the bioassay, consumption of water collected
  from a site in Benton Lake NWR with a specific conductance of 15,500 pS/cm significantly
  reduced duckling growth compared to the freshwater spring treatment. Drinking water
  treatments having a specific conductance of 5,920 uS/cm or less did not adversely
  affect duckling growth. Therefore, exposure to moderately saline water adversely
  affected duckling growth during the entire 28-day exposure. These findings indicate
  that measurement of specific conductance in wetland habitats can be used to identify
  saline surface waters that pose a hazard to duckling health.\",\n\t\"license_title\":
